import {SET_PAGE, SET_USERS} from "./actionConstants";

export const getUsersByPage  = (page) => {
    return dispatch => {
        fetch(
            `/users/page/${page}`,
            {
                headers: {
                    "Access-Control-Allow-Origin": "*",
                    "Content-Type": "application/json",
                    'Access-Control-Allow-Headers': "*"
                },
                mode: "cors"
            }
        )
            .then(res => {
                return res.json();
            })
            .then(json => dispatch(setUsers(json)))
            .catch(error => {
                console.log(error);
            });
    }
}

export const setUsers = users => ({
    type: SET_USERS,
    payload: {
        users: users
    }
});

export const setPage = page => ({
    type: SET_PAGE,
    payload: {
        page: page
    }
});
